import Logo from '../../img/Logo_Buscaki.png'

function Login(){

    function Tamanho () {
        const margin = document.getElementById("margin")
        const body = document.getElementById("body");
        margin.style.marginTop = window.innerHeight / 6 + "px";
      }
      window.onload = Tamanho;

    return(
        <div id="body">
            <div class="container j-center">
                <div id="margin" class="row j-login">
                    <div class="col-12 col-sm-7 col-md-6 col-lg-7 ">
                        <img class="col-12 j-elementos-login" src={Logo} alt="" />
                    </div>
                    <div class="col-12 col-sm-12 col-md-6 col-lg-5  p-5">
                        <div class="j-elementos-login">
                            <h1 class="text-center">LOGIN</h1>
                            <input type="text"  placeholder="email" name="email" id="" class="col-12 m-2 p-1 j-input-login" />
                            <input type="password" placeholder="senha" name="senha" id="" class="col-12 m-2 p-1 j-input-login" />
                            <button type="button" class="col-12 m-2 btn btn-outline-info">Registre-se</button>
                            <p class="text-center">
                                Esqueceu o E-mail / Senha?
                            </p>
                            <p class="text-center m-5">
                                <a href="">Crie sua conta aqui</a>
                            </p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}


export default Login;
